                  : "DAU, 결제금액 등 핵심 지표 생성"}
              </span>
            </div>
          </div>
        </div>
      </div>

      {/* 게이밍 스타일 Completion */}
      <div
        style={{
          padding: "24px",
          background: colors.cardBg,
          boxShadow: "0 8px 24px rgba(0, 0, 0, 0.2)",
          borderRadius: "20px",
          border: `1px solid ${colors.cardBorder}`,
          backdropFilter: "blur(20px)",
          position: "relative",
          overflow: "hidden",
        }}
      >
        {/* 배경 장식 */}
        <div
          style={{
            position: "absolute",
            top: "-50%",
            left: "-20%",
            width: "120px",
            height: "120px",
            background: understood
              ? "linear-gradient(135deg, rgba(16, 185, 129, 0.2), rgba(5, 150, 105, 0.2))"
              : "linear-gradient(135deg, rgba(139, 92, 246, 0.1), rgba(59, 130, 246, 0.1))",
            borderRadius: "50%",
            filter: "blur(30px)",
            transition: "all 0.3s ease",
          }}
        />

        <div
          style={{
            display: "flex",
            alignItems: "center",
            gap: "16px",
            position: "relative",
            zIndex: 1,
          }}
        >
          <div
            style={{
              width: "48px",
              height: "48px",
              background: understood
                ? "linear-gradient(135deg, #10b981, #059669)"
                : "linear-gradient(135deg, #8b5cf6, #3b82f6)",
              borderRadius: "16px",
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
              boxShadow: understood
                ? "0 8px 20px rgba(16, 185, 129, 0.4)"
                : "0 8px 20px rgba(139, 92, 246, 0.4)",
              transition: "all 0.3s ease",
            }}
          >
            {understood ? (
              <Trophy size={24} color="white" />
            ) : (
              <Star size={24} color="white" />
            )}
          </div>
          <div style={{ flex: 1 }}>
            <div
              style={{
                display: "flex",
                alignItems: "flex-start",
                gap: "12px",
                cursor: "pointer",
              }}
              onClick={() => setUnderstood(!understood)}
            >
              <div
                style={{
                  width: "24px",
                  height: "24px",
                  borderRadius: "6px",
                  border: `2px solid ${
                    understood ? colors.success : theme.cardBorder
                  }`,
                  background: understood ? colors.success : "transparent",
                  display: "flex",
                  alignItems: "center",
                  justifyContent: "center",
                  transition: "all 0.3s ease",
                  flexShrink: 0,
                  marginTop: "2px",
                }}
              >
                {understood && (
                  <div
                    style={{
                      color: "white",
                      fontSize: "14px",
                      fontWeight: "bold",
                    }}
                  >
                    ✓
                  </div>
                )}
              </div>
              <span
                style={{
                  color: theme.text,
                  fontSize: "16px",
                  fontWeight: "600",
                  lineHeight: "1.5",
                  flex: 1,
                }}
              >
                {understood
                  ? t("step4.finalMissionComplete")
                  : t("step4.analysisStepComplete")}
              </span>
            </div>
            {understood && (
              <div
                style={{
                  marginTop: "12px",
                  padding: "12px 16px",
                  background: `${colors.success}15`,
                  borderRadius: "12px",
                  border: `1px solid ${colors.success}30`,
                }}
              >
                <div
                  style={{
                    display: "flex",
                    alignItems: "center",
                    gap: "8px",
                    fontSize: "14px",
                    color: colors.success,
                    fontWeight: "600",
                  }}
                >
                  <Trophy size={16} />
                  {t("step4.finalRewardEarned")}
                </div>
              </div>
            )}
          </div>
        </div>
      </div>

      {/* 게이밍 스타일 Celebration Modal */}
      {celebrationShown && (
        <div
          style={{
            position: "fixed",
            top: 0,
            left: 0,
            right: 0,
            bottom: 0,
            backgroundColor: "rgba(0, 0, 0, 0.8)",
            backdropFilter: "blur(20px)",
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
            zIndex: 1000,
            padding: "20px",
          }}
        >
          <div
            style={{
              background: theme.cardBg,
              border: `1px solid ${theme.cardBorder}`,
              padding: "48px",
              borderRadius: "24px",
              maxWidth: "600px",
              margin: "20px",
              textAlign: "center",
              boxShadow:
                "0 20px 50px rgba(139, 92, 246, 0.3), 0 0 100px rgba(59, 130, 246, 0.2)",
              position: "relative",
              overflow: "hidden",
            }}
          >
            {/* 배경 장식 */}
            <div
              style={{
                position: "absolute",
                top: "-30%",
                left: "-20%",
                width: "150px",
                height: "150px",
                background:
                  "linear-gradient(135deg, rgba(139, 92, 246, 0.2), rgba(59, 130, 246, 0.2))",
                borderRadius: "50%",
                filter: "blur(40px)",
              }}
            />
            <div
              style={{
                position: "absolute",
                bottom: "-30%",
                right: "-20%",
                width: "120px",
                height: "120px",
                background:
                  "linear-gradient(135deg, rgba(16, 185, 129, 0.2), rgba(5, 150, 105, 0.2))",
                borderRadius: "50%",
                filter: "blur(40px)",
              }}
            />

            <button
              onClick={() => setCelebrationShown(false)}
              style={{
                position: "absolute",
                top: "20px",
                right: "20px",
                background: "rgba(255, 255, 255, 0.1)",
                border: `1px solid ${theme.cardBorder}`,
                cursor: "pointer",
                padding: "8px",
                borderRadius: "12px",
                color: theme.textSecondary,
                fontSize: "0",
                backdropFilter: "blur(10px)",
                transition: "all 0.3s ease",
                zIndex: 1,
              }}
              onMouseEnter={(e) => {
                (e.currentTarget as HTMLElement).style.background =
                  "rgba(255, 255, 255, 0.2)";
                (e.currentTarget as HTMLElement).style.color = theme.text;
              }}
              onMouseLeave={(e) => {
                (e.currentTarget as HTMLElement).style.background =
                  "rgba(255, 255, 255, 0.1)";
                (e.currentTarget as HTMLElement).style.color =
                  theme.textSecondary;
              }}
            >
              <X size={20} />
            </button>
            <div
              style={{
                display: "flex",
                justifyContent: "center",
                marginBottom: "24px",
                position: "relative",
                zIndex: 1,
              }}
            >
              <div
                style={{
                  width: "80px",
                  height: "80px",
                  background: "linear-gradient(135deg, #f59e0b, #d97706)",
                  borderRadius: "24px",
                  display: "flex",
                  alignItems: "center",
                  justifyContent: "center",
                  boxShadow: "0 8px 25px rgba(245, 158, 11, 0.4)",
                  animation: "pulse 2s infinite",
                }}
              >
                <PartyPopper size={40} color="white" />
              </div>
            </div>
            <h4
              style={{
                fontSize: "32px",
                fontWeight: "800",
                margin: "0 0 20px 0",
                background: "linear-gradient(135deg, #f59e0b, #d97706)",
                WebkitBackgroundClip: "text",
                WebkitTextFillColor: "transparent",
                position: "relative",
                zIndex: 1,
              }}
            >
              {t("step4.congratulationsQuestComplete")}
            </h4>
            <p
              style={{
                fontSize: "18px",
                margin: "0 0 36px 0",
                lineHeight: "1.6",
                color: theme.textSecondary,
                position: "relative",
                zIndex: 1,
              }}
            >
              <strong style={{ color: theme.text }}>
                {t("step4.quickStartComplete")}
              </strong>
              <br />
              {t("step4.exploreDataAnalysisWorld")}
            </p>
            <div
              style={{
                display: "flex",
                justifyContent: "center",
                gap: "16px",
                marginBottom: "24px",
                position: "relative",
                zIndex: 1,
              }}
            >
              <div
                style={{
                  padding: "12px 20px",
                  background: `${colors.success}15`,
                  borderRadius: "12px",
                  border: `1px solid ${colors.success}30`,
                }}
              >
                <span
                  style={{
                    fontSize: "14px",
                    color: theme.success,
                    fontWeight: "600",
                    display: "flex",
                    alignItems: "center",
                    gap: "8px",
                  }}
                >
                  {t("step4.rewardEarned500XP")}
                </span>
              </div>
            </div>
            <div
              style={{
                display: "flex",
                justifyContent: "center",
                gap: "16px",
                flexWrap: "wrap",
                position: "relative",
                zIndex: 1,
              }}
            >
              <button
                onClick={() => window.open("http://localhost:3002/", "_blank")}
                style={{
                  padding: "14px 28px",
                  border: `2px solid ${theme.cardBorder}`,
                  borderRadius: "16px",
                  background: "rgba(255, 255, 255, 0.1)",
                  color: theme.text,
                  fontSize: "16px",
                  fontWeight: "600",
                  cursor: "pointer",
                  transition: "all 0.3s ease",
                  backdropFilter: "blur(10px)",
                  display: "flex",
                  alignItems: "center",
                  gap: "8px",
                }}
                onMouseEnter={(e) => {
                  (e.currentTarget as HTMLElement).style.transform =
                    "translateY(-2px)";
                  (e.currentTarget as HTMLElement).style.boxShadow =
                    "0 8px 20px rgba(139, 92, 246, 0.3)";
                  (e.currentTarget as HTMLElement).style.background =
                    "rgba(255, 255, 255, 0.15)";
                }}
                onMouseLeave={(e) => {
                  (e.currentTarget as HTMLElement).style.transform =
                    "translateY(0)";
                  (e.currentTarget as HTMLElement).style.boxShadow = "none";
                  (e.currentTarget as HTMLElement).style.background =
                    "rgba(255, 255, 255, 0.1)";
                }}
              >
                {t("step4.goHome")}
              </button>
              <button
                onClick={() =>
                  window.open("https://te-web-naver.thinkingdata.kr/", "_blank")
                }
                style={{
                  padding: "14px 28px",
                  border: "none",
                  borderRadius: "16px",
                  background: "linear-gradient(135deg, #8b5cf6, #3b82f6)",
                  color: "white",
                  fontSize: "16px",
                  fontWeight: "600",
                  cursor: "pointer",
                  transition: "all 0.3s ease",
                  boxShadow: "0 4px 16px rgba(139, 92, 246, 0.3)",
                  display: "flex",
                  alignItems: "center",
                  gap: "8px",
                }}
                onMouseEnter={(e) => {
                  (e.currentTarget as HTMLElement).style.transform =
                    "translateY(-2px)";
                  (e.currentTarget as HTMLElement).style.boxShadow =
                    "0 8px 24px rgba(139, 92, 246, 0.4)";
                }}
                onMouseLeave={(e) => {
                  (e.currentTarget as HTMLElement).style.transform =
                    "translateY(0)";
                  (e.currentTarget as HTMLElement).style.boxShadow =
                    "0 4px 16px rgba(139, 92, 246, 0.3)";
                }}
              >
                {t("step4.startAnalysis")}
              </button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};
